Question: Candice picked 80 sheets of postcards and put them in her handbag before going to work at the coffee shop. On her way, she stopped at a store and bought a package of postcards. During her work, she put one sheet of postcard on each of 220 cups of coffee. If she has 23 sheets of postcards left, how many sheets of postcards did she buy in the store?

To solve this, we need to calculate the total number of postcards Candice bought. She initially had 80 sheets and ended up with 23 sheets, which means she used 80 - 23 = 57 sheets for her work. Since she used one sheet for each of the 220 cups of coffee, she must have bought 57 sheets in the store.

The number of postcards she bought in the store is \\boxed{57}

Translation: John adopted a dog and took it to the groomer for a $100 cut. However, the grooming shop offers a 30% discount to new customers. How much will the dog's haircut cost?

To calculate the discounted price, we first find 30% of $100, which is $100 * 0.30 = $30. Subtracting this discount from the original price gives us $100 - $30 = $70.

Therefore, the dog's haircut will cost $\\boxed{70}
